ge White Stoneware Bowl: https://fave.co/3CKUrzr\r\n(Similar) Shallow Bowl-Large Concrete Bowl: https://fave.co/3RmlWDr\r\n(Similar) Kelly Clarkson Home Anya Tall Glass End Table: https://fave.co/3CI4DJ9\r\n(Similar) Black rustic jug with handles: https://fave.co/3COCu31\r\n(Similar) Pottery Barn Eclectic Planter, White, Large Cachepot: https://fave.co/3Q3XfKY\r\nWe love the wicker lighting fixtures scattered throughout the family‚Äôs home, here‚Äôs a few we found to add a similar airy quality to your own space:\r\n(Similar) Threshold Addison Rattan Table Lamp Brown: https://goto.target.com/oedLDe\r\n(Similar) Anthropologie Rattan Empire Lamp Shade: https://fave.co/3TnJmdw\r\n(Similar) Urban Outfitters Cane Lamp Shade: https://fave.co/3Q8thFM\r\n(Similar) Wayfair Chris Table Lamp: https://fave.co/3B0Kdtr\r\n(Similar) Ballard Designs Wicker Lamp Shade: https://fave.co/3RkPQYU\r\n\r\nWhen you buy something through our retail links, we earn an affiliate commission.\r\n\r\nWedding Photographs by Gigi de Manio Photography\r\n\r\n\"Sur Le Nil\" Animal Wallpaper by Pierre Frey https://www.pierrefrey.com/en/products/FP482-FP482001\r\n\r\n\"Pig\" Leather Footstool by Omersa\r\n\r\nDirector: Hiatt Woods\r\nDirector of Photography: Josh Herzog\r\nEditor(s): Tristen Rogers\r\nTalent: Nate Berkus, Jeremiah Brent\r\nLine Producer: Joseph Buscemi\r\nProducer: Chase Lewis\r\nAssociate Producer: Brandon Fuhr\r\nProduction Manager: Melissa Heber\r\nProduction Coordinator: Fernando Davila\r\nCamera Operator: Brittany Berger\r\nAudio: Lily Van Leewun\r\nPost Production Supervisor: Nick Ascanio, Alexa Deutsch\r\nPost Production Coordinator: Ian Bryant\r\nSupervising Editor: Doug Larsen\r\nAssistant Editor: Billy Ward\r\nGraphics Supervisor: Ryan Powell\r\n\n\nWant even more AD? Subscribe to the magazine and get a free tote ‚ñ∫‚ñ∫ http://bit.ly/2H7oOSG\r\nStill haven‚Äôt subscribed to Architectural Digest on YouTube? ‚ñ∫‚ñ∫ http://bit.ly/2zl7s34\r\n\r\nABOUT ARCHITECTURAL DIGEST\r\nThe leading international design authority, Architectural Digest features articles and videos of the best in architecture, style, culture, travel, and shopping."
